function Videos() {
    return (
       <Wrapper  className="homeBackground">
            <h1>My Videos</h1>
            <VideoCard/>




<Title className="gallerytitle">Video Gallery</Title>
<div className="intro">
    Here you can find examples of the videos I have completed to date.
</div>
<div className="galleryCard">
    {portfolio.map(project => <ProjectCard key={project.id} project={project} />)}
</div>
</Wrapper>
    )
}

export default Videos
